import React from "react";
import GlobalStyles from "../globalStyles";
import Navbar from "../components/Navbar";
import Hero from "../components/Hero";
const Home = () => {
  return (
    <React.Fragment>
      <GlobalStyles />
      <Navbar />
      <Hero />
    </React.Fragment>
  );
};

export default Home;
